import axios from "axios";

const api = axios.create({
  baseURL: "http://127.0.0.1:8000",
  headers: {
    'Access-Control-Allow-Origin': '*',
    'Content-Type': 'application/json',
  },
});

function getPetNames(specie) {
    const [petNames, setPetNames] = React.useState([]);

    useEffect(() => {
        api
        .post("/nlp-pet-name",{
            specie: 'dog'
        })
        .then((response) => setPetNames(response.data))
        .catch((err) => {
            console.error("ops! ocorreu um erro" + err);
        });
    }, []);
  return api.post("/nlp-pet-name",{
    specie: specie
  });
}


export default api;
